import React from 'react';

const Hero = ({handleLogout}) => {
    return (
        <div className="hero">
            <div>
            <div align="center">
                <h1> WellCome To our Website</h1>
                
            </div>
            </div>
            <button onClick={handleLogout}>Logout</button>
        </div>
        
    );
};

export default Hero;
